import React from "react";
import { NavLink, Route, BrowserRouter as Router, Routes } from "react-router-dom";
 import Aboutus from "./aboutus";
 import login from "./login";
 import contactus from "./contactus";
 import Maincomponent from "./Maincomponent";
export default class IndexComponent extends React.Component {
render() {
return (
<div className="nav nav-pills">
<Router>
<div className="nav-item">
<NavLink className='nav-link' to='/aboutus'>Aboutus</NavLink>
</div>
<div className="nav-item">
<NavLink className='nav-link' to='/contactus'>contactus</NavLink>
</div>
<div className="nav-item">
<NavLink className='nav-link' to='/Signup'>Signup</NavLink>
</div>
<div className="nav-item">
<NavLink className='nav-link' to='/login'>login</NavLink>
</div>
{/* <Routes>
<Route path="/create" element={<InsertComponent />}></Route>
<Route path="/read" element={<ReadComponent />}></Route>
<Route path="/update" element={<UpdateComponent />}></Route>
<Route path="/delete" element={<DeleteComponent />}></Route>
</Routes> */}
</Router>
</div>
)
}
}
